{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/colejacobson/surge-a-measurement-for-hidden-defensive-impact?scriptVersionId=158376289\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"attachments":{"53e7af8d-db6d-41ba-8f1b-9384ed6eca53.png":{"image/png":""},"7f62e6ad-0859-4889-8f78-b6de383b838d.png":{"image/png":""},"8257abc0-25bf-4368-8993-b05b0bc313b0.png":{"image/png":""},"e3556820-1804-4a8c-876c-3899f27d6847.png":{"image/png":""}},"cell_type":"markdown","id":"930f55e7","metadata":{"papermill":{"duration":0.011136,"end_time":"2024-01-10T01:11:59.383662","exception":false,"start_time":"2024-01-10T01:11:59.372526","status":"completed"},"tags":[]},"source":["# **Introduction**\n","\n","For almost as long as the game has existed, [its been extremely difficult to evaluate defensive players](https://www.advancedfootballanalytics.com/2010/03/measuring-defensive-playmakers.html) in football. Even as the [list of metrics officially measured by the league](https://www.pro-football-reference.com/about/coverage.htm) has grown -- from interceptions in 1940, to individual sacks in 1982, all the way to metrics like QB hits and pass breakups that the common fan can see today -- its remained exponentially more challenging to evaluate the individual defenders than their offensive counterparts. While we do not have the hubris to pretend that we can solve this problem on our own, we hope that the following concept can provide a boost to fans, coaches, and front office members alike: Surge.\n","\n","Not all tackles are created equal. Some are much more valuable to the defense than others based on game situations, and some are much easier to make than others. This latter concept provided the core question that we attacked in this project. Who provides hidden value by disrupting ball-carriers, therefore setting up easier tackles for their teammates?\n","\n","# **Data Preparation** \n","\n","Our analysis utilized a combination of NFL-provided tracking data, and [analytics tools from NFLVerse](https://nflverse.nflverse.com/), for all completions, designed runs, and scrambles from Weeks 1-9, 2022. We provided further manipulations, such as excluding any frames that came before a ball-carrier had received the ball, and any frames that came after a tackle or turnover occurred. \n","\n","Furthermore, when building the model described below, we excluded players that were more than 10 yards away from the ball-carrier at any given moment. It would be nearly impossible for that defender to surge and reach the ball-carrier in such a short time span (for frame of reference, the fastest NFL players maximum speed hovers around 11 yards per second). \n","\n","# **Model Description**\n","\n","Our group built a [logistic regression](https://www.ibm.com/topics/logistic-regression) model that outputs the probability of any defender being within a yard of the ball-carrier -- which we define as a **Surge** from here on out -- in the next half-second. We tested [random forest](https://www.ibm.com/topics/random-forest) models as well, as shown in our attached code, but validation metrics showed that logistic regression was more accurate, not to mention more easily interpretable by a reader without a technical background.\n","\n","This model illuminates the importance of different players in disrupting plays and creating tackle opportunities, even when they are not credited. Understanding the effectiveness of these players gives coaches a better way to evaluate defenders beyond what a traditional box score conveys.\n","\n","Our first step was to quantify what entails being blocked. To a large extent, diagnosing a block is you know it when you see it. But the dynamics of blocking are so frequent over a single play, let alone a nine-week span of a season, that it becomes impractical for any scout or coach to try to grasp them all nationwide.\n","\n","This is where our model can be of assistance. Below is a detailed summary of our models features, which included a Blocked Score to measure the degree to which each defender was blocked:\n","\n","To account for field congestion, we measured **the number of potential blockers** between a defender and the ball-carrier. We only considered defenders within 10 yards of the ball-carrier, and for each of those defenders, we drew a sector of a circle from the ball-carrier toward the defender. The ball-carrier represented the center of these circle sectors, and the sector angles totaled 60 degrees, with 30 degrees extending each way from the ball-carrier, as shown below.\n","\n","![Screenshot 2024-01-08 at 3.55.33 PM.png](attachment:53e7af8d-db6d-41ba-8f1b-9384ed6eca53.png)\n","\n","The number of potential blockers does not truly represent how blocked a defensive player is, so our group devised a [greedy optimization algorithm](https://www.freecodecamp.org/news/greedy-algorithms/) to pair up defenders and blockers. Details are in [our GitHub](https://github.com/jacole3/HungryDogs_BDB_2023_24), but to summarize, this involves creating potential pairs of blockers and defenders based on their distance from one another. As a result, no single blocker could be assigned to more than two defenders. ([George Kittle will disagree](https://www.mercurynews.com/wp-content/uploads/2023/12/SJM-49ERS-12.jpg?w=978), but he's the exception, not the rule.) Once all unique pairs in the radius were selected, any remaining blockers were assigned to the closest defender, while any remaining defenders were left unblocked. The overall score for how well a defender is blocked, which we named **Blocked Score** is quantified by the equation:\n","\n"," **ln((1-cos(O2-O1))(Mass of Blocker)(Speed of Blocker))**\n"," \n","This represents the blockers [momentum](https://www.physicsclassroom.com/Class/momentum), multiplied by his relative orientation to the defender. We then normalized these scores between zero and one (one means a player is as blocked as possible, while zero means he is completely unblocked).\n","\n","Using [Pythagorean Theorem principles](https://mathworld.wolfram.com/PythagoreanTheorem.html), we tracked the **current distance of the defender to the ball-carrier.**\n","\n","By accounting for players angle and speed, we also created a projected future position. Looking exactly half a second into the future wouldnt properly account for situations where a defender was already close to the ball-carrier and moving very fast, as the large projected distance would be overstated. To resolve this issue, **we took the minimum projected distance between each defender and the ball-carrier over any point of the next 0.5 seconds.** This metric was valuable because it illuminated how players moved throughout the play.\n","\n","\n","\n","Lastly, we give each player within the 10-yard radius a **ranking based on his distance to the ball-carrier** (e.g., if there is one defensive player and one offensive player between Defender X and the ball-carrier, Defender Xs rank would be 3).\n","\n","With these features (along with a couple of [interactions](https://www.statisticssolutions.com/statistical-interaction-more-than-the-sum-of-its-parts/) between them), we used logistic regression to estimate any defenders probability of a **surge** in the next half-second.\n","\n","# **Real-World Example: What Does a Surge Mean?**\n","\n","No matter how much statistical jargon we emit, any fan, coach, or analyst will eventually settle on the same question: how does this show up on the field?\n","\n","Consider this example, which came in the Packers loss to the Commanders in Week 7, 2022. Running an outside zone read with #96 James Smith-Williams as the read key, #12 Aaron Rodgers handed the ball to #33 Aaron Jones, but almost immediately after the snap, #93 Jonathan Allen -- lined up as a [3-tech](https://www.thephinsider.com/2014/3/7/5482102/football-101-defensive-line-gap-techniques) to the playside -- used a swim move to get between C #71 Josh Myers and LG #74 Elgton Jenkins. Though Allen did not make the tackle, his explosion into the backfield forced Jones to re-direct, leading to a six-yard loss and a Packers three-and-out.\n","\n","![Screenshot 2024-01-08 at 3.56.07 PM.png](attachment:7f62e6ad-0859-4889-8f78-b6de383b838d.png)\n","\n","![All-22 Dots for Jones Rush](/kaggle/input/2023-24-bdb-surge-visualizations/Aaron Jones Rush Dots.mp4)\n","\n","By conventional metrics, Allen would be shut out of the box score. In fact, he actually had a missed tackle on the play, via PFF. But when watching the play, its flagrant that Allen was the primary reason the play went south for Green Bay. Now, we have a way to quantify it.\n","\n","Using the logistic regression model described earlier, the below graph displays each defenders Surge probability over the course of this play. Allen leads the way with an extremely early, and extremely steep spike, before several other teammates follow suit. \n","\n","![Surge Line Graph for Jones Rush](/kaggle/input/2023-24-bdb-surge-visualizations/Jonathan Allen Surge Line Graph.mp4)\n","\n","Though Allen didnt make the tackle, his immediate Surge was a clear [hockey assist](https://www.freshgear.com/hockey-faqs/what-is-a-hockey-assist/). And that, ultimately, is the basis of the Surge measurement. While the player with the Surge will often make a tackle, his impact can still be tremendous even if he doesnt, as he can set up an easier play for teammates.\n","\n","# **Analysis: Surge Rate Leaderboards**\n","\n","Needless to say, the purpose of a project like this is not to break down one play at a time, but rather to create all-encompassing takeaways for a General Manager or pro scout that might not be able to watch every snap by every player.\n","\n","By aggregating our frame-by-frame stats into play-by-play stats, we were able to do so. Below is a leaderboard of both the highest Surge Rate and Surge Rate Over Expected among players with 150+ defensive snaps in our data set. Surge Rate is as simple as it sounds: Surges divided by overall snaps. But while Surge Rate is informative on its own, its not immune to some bias, as certain position groups (largely off-ball linebackers) have higher chances of getting close to the ball than others.\n","\n","As such, we also created Surge Rate Over Expected. This entails how many more surges a player had than our logistic regression model expected, on a play-to-play basis.\n","\n","![Screenshot 2024-01-08 at 3.57.41 PM.png](attachment:8257abc0-25bf-4368-8993-b05b0bc313b0.png)\n","\n","This leaderboard consists of all defensive plays, but we could easily filter down to specific play types, position groups, or game situations. In this board, AFC West linebackers Alex Singleton and Drue Tranquill particularly stand out.\n","\n","Being able to get a Surge is only one part of the equation, though. If you dive at an offensive players legs and miss, and then he goes on to score a touchdown, your Surge didnt do very much to help your teammates. Consequently, its important to evaluate not only who excels at getting Surges, but also who makes a significant impact to the defense on such plays.\n","\n","To evaluate this, we created the below leaderboard. On the left side is a leaderboard for who had the highest tackle rate, among plays where they had Surges, from Weeks 1-9, 2022. On the right side, we incorporate NFLVerses [Expected Points Added](https://opensourcefootball.com/posts/2020-09-28-nflfastr-ep-wp-and-cp-models/) metric, evaluating which defensive players team had the lowest average EPA allowed on plays during which that player had a Surge.\n","\n","![Screenshot 2024-01-08 at 3.57.52 PM.png](attachment:e3556820-1804-4a8c-876c-3899f27d6847.png)\n","\n","Recall that since EPA is recorded from the offenses perspective, a low number is what the defense wants. With that in mind, we can see that tackles per surge tends to be a very DB-heavy metric, given that defensive backs are often near the receivers they are guarding, while the lowest EPA leaderboard has some of the sports top defensive linemen near the top. Manipulating these rankings by play type and position group would give even further insight.\n","\n","# **Designed Run Breakdown**\n","\n","Since many tackles are made in the run game, it was only right to explore such plays further. The provided data did not include PFF pre-snap alignments, but we were able to use the tracking data to define each defenders aligned position and pre-snap gap.\n","\n","This was important for multiple reasons. First, position labels arent typically a fair depiction of players responsibilities. For example, Bobby Wagner and Von Miller are both listed as linebackers, but they evidently dont have the same tasks. Furthermore, each players gap alignment allows us to evaluate how they performed on plays near them.\n","\n","One such example comes when examining each players Surge Rate on designed runs that went within one gap of the players pre-snap alignment. Code for this leaderboard can be seen in the [Aggregating Frames to Plays](https://github.com/jacole3/HungryDogs_BDB_2023_24/blob/main/Aggreggate_Frames_To_Plays_10.R) section of our GitHub page. This concept has limitations on a play-to-play basis, particularly due to the presence of pulling linemen. It isnt always fair to say that the defender(s) lined up in the area that the ball ended up going were responsible for the plays outcome. Nonetheless, it provides a glimpse into which defenders consistently made an impact on plays near them in the run game.\n","\n","# **Conclusion**\n","\n","We hope this concept can provide value to coaches and front office executives, not only in their ability to evaluate their own players, but also opposing players and prospective acquisitions. The essential premise of the project is to identify players with hidden value, an omnipresent goal for any team trying to find salary cap bargains.\n","\n","With infinite time and resources, there are several other sub-topics wed like to explore. Among them: evaluating year-to-year stability of Surge Rate, building separate models for each play type, evaluating offensive players to the same extent, and creating a synthetic metric combining Surge Rate and tackling ability to grade defensive impact.\n","\n","Likewise, our work does have some limitations. One was the institution of the 10-yard radius. While necessary to improve model accuracy, this provided a harsh cut-off that made it possible for a defender to have an extremely abrupt jump in Surge probability once they entered the radius. Another core limitation was the inherent impossibility of assigning blockers to defenders without the assistance of video, though we felt our compromise was reasonable given the circumstances.\n","\n","All code can be seen at [this GitHub link](https://github.com/jacole3/HungryDogs_BDB_2023_24)."]},{"cell_type":"code","execution_count":1,"id":"5c3670d0","metadata":{"execution":{"iopub.execute_input":"2024-01-10T01:11:59.406872Z","iopub.status.busy":"2024-01-10T01:11:59.40623Z","iopub.status.idle":"2024-01-10T01:11:59.488636Z","shell.execute_reply":"2024-01-10T01:11:59.487477Z"},"papermill":{"duration":0.09713,"end_time":"2024-01-10T01:11:59.49084","exception":false,"start_time":"2024-01-10T01:11:59.39371","status":"completed"},"tags":[]},"outputs":[{"data":{"image/jpeg":"\n","text/html":["\n","        <iframe\n","            width=\"700\"\n","            height=\"450\"\n","            src=\"https://www.youtube.com/embed/fd3GTuIGIKI\"\n","            frameborder=\"0\"\n","            allowfullscreen\n","            \n","        ></iframe>\n","        "],"text/plain":["<IPython.lib.display.YouTubeVideo at 0x7dd6505f6bf0>"]},"execution_count":1,"metadata":{},"output_type":"execute_result"}],"source":["from IPython.display import YouTubeVideo\n","YouTubeVideo('fd3GTuIGIKI', width=700, height=450)"]}],"